import PlayerHeading from "../../components/PlayerHeading";

import tyronethompson from "./assets/images/tyronethompson.png";
import ollienorris from "./assets/images/ollienorris.png";

const players = [
  {
    playerName: {
      firstName: "Tyrone",
      lastName: "Thompson",
      number: "12",
    },
    photo: tyronethompson,
    stats: [
      { attr: "OFF", value: 120 },
      { attr: "AST", value: 98 },
      { attr: "TCK", value: 86 },
      { attr: "TRY", value: 99 },
      { attr: "PAS", value: 85 },
      { attr: "DEF", value: 65 },
    ],
    details: [
      { label: "Height", value: "6'5\"" },
      { label: "Weight", value: "111 kg" },
      { label: "Age", value: "26" },
      {
        label: "College",
        value: "Rockbell Bay College",
      },
      {
        label: "Born",
        value: "Wellington, California. NZ",
      },
      { label: "Position", value: "Prop" },
    ],
  },
  {
    playerName: {
      firstName: "Ollie",
      lastName: "Norris",
      number: "12",
    },
    photo: ollienorris,
    stats: [
      { attr: "OFF", value: 120 },
      { attr: "AST", value: 98 },
      { attr: "TCK", value: 86 },
      { attr: "TRY", value: 99 },
      { attr: "PAS", value: 85 },
      { attr: "DEF", value: 65 },
    ],
    details: [
      { label: "Height", value: "6'5\"" },
      { label: "Weight", value: "111 kg" },
      { label: "Age", value: "26" },
      {
        label: "College",
        value: "Rockbell Bay College",
      },
      {
        label: "Born",
        value: "Wellington, California. NZ",
      },
      { label: "Position", value: "Prop" },
    ],
  },
];

export default function PlayersPage() {
  return (
    <section>
      {players.map(({ playerName, photo, stats }, index) => (
        <PlayerHeading playerName={playerName} photo={photo} stats={stats} />
      ))}
    </section>
  );
}
